import React from 'react';

class App2 extends React.Component {

    constructor(props) {
        super(props);
    }

  render() {
    return(
      <div className='box'>
          <div id='title'>{this.props.title}</div>
          <div id='text'>{this.props.text}</div>
      </div>
    )
  }
}

export default App2;
